- Apart from Staging mode, your HUD also has a Docking mode, press the Docking button under the stages on the lower left of the screen. What this does is change the control scheme from rotation to translation, so your W, A, S, D keys will control translation and LeftShit and LeftControl are up and down, a bit like controlling a Kerbal EVA.

- Using docking mode isn't strictly necessary. Use whichever mode works best for you, but remember you can use the I, K, J, L, H and N to translate in the normal Staging mode, you can check the key bindings at any time in the Pause Menu.

